contract oddEve{
    uint public score;
    uint randomnumber;

    constructor()
    {
        score = 0;
        randomnumber=4;
    }
    
    /*function test() public view returns (string memory)
    {
        string memory a="fd";
        return a;
    }*/

    function takeinput(uint _inputnumber) public  returns (string memory){
        if (_inputnumber<1 || _inputnumber >6){
            return "Please Enter a Valid Number";
        }
            
        else
        {
            //generate a randomnumber
            
            if (randomnumber==_inputnumber)
            {
                return "-- OUT";	//yet to implement

            }
            else
            {
                score = score + randomnumber;
                return "randonumber RUNS";	//yet to implement
            }
        }
    }

    function reset() public  returns (string memory){
        score = 0;
        return "Game RESET";
    }

}

